<div id="page-container">
<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w0 h0" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w0 h1"><div class="t m0 x1 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x2 h3 y3 ff1 fs1 fc0 sc0 ls0 ws0">Bhutan Echoes<span class="fs2"> - <span class="ff2 fs3 fc1">Drukyul&apos;s Literature Festival Bhutan Echoes</span> </span></div></div><div class="t m0 x1 h4 y4 ff3 fs4 fc0 sc0 ls0 ws0">Our Commitment to Child Safety and Protection Against </div><div class="t m0 x1 h4 y5 ff3 fs4 fc0 sc0 ls0 ws0">Sexual Abuse and Exploitation </div><div class="t m0 x1 h5 y6 ff3 fs2 fc0 sc0 ls0 ws0">Last updated: 18-July-2025 </div><div class="t m0 x1 h6 y7 ff1 fs2 fc0 sc0 ls0 ws0">At <span class="ff3">Bhutan Echoes</span>, we are firmly committed to protecting children from a<span class="_ _0"></span>ll forms of sexual </div><div class="t m0 x1 h6 y8 ff1 fs2 fc0 sc0 ls0 ws0">abuse and exploitation (CSAE) across our platform. W<span class="_ _0"></span>e adhere to global best practices, <span class="_ _0"></span>comply </div><div class="t m0 x1 h6 y9 ff1 fs2 fc0 sc0 ls0 ws0">with applicable laws, and actively enforce strict policies to safeguard use<span class="_ _0"></span>rs—especially minors. </div><div class="t m0 x1 h7 ya ff3 fs5 fc0 sc0 ls0 ws0">Our Standards </div><div class="t m0 x3 h6 yb ff1 fs2 fc0 sc0 ls0 ws0">1. <span class="_ _1"> </span><span class="ff3">Zero T<span class="_ _2"></span>olerance Policy </span></div><div class="t m0 x2 h6 yc ff1 fs2 fc0 sc0 ls0 ws0"> We strictly pro<span class="_ _0"></span>hibit any content, behavior<span class="_ _2"></span>, or user activity that promotes, depicts, or </div><div class="t m0 x2 h6 yd ff1 fs2 fc0 sc0 ls0 ws0">facilitates child sexual abuse, exploitation, or grooming. V<span class="_ _0"></span>iolations lead to immediate </div><div class="t m0 x2 h6 ye ff1 fs2 fc0 sc0 ls0 ws0">account termination and reporting to relevant law enforcement. </div><div class="t m0 x2 h6 yf ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h6 y10 ff1 fs2 fc0 sc0 ls0 ws0">2. <span class="_ _1"> </span><span class="ff3">Proactive Moderation </span></div><div class="t m0 x2 h6 y11 ff1 fs2 fc0 sc0 ls0 ws0"> Our platform uses AI-based moderation and human review to detect and<span class="_ _0"></span> prevent </div><div class="t m0 x2 h6 y12 ff1 fs2 fc0 sc0 ls0 ws0">CSAE-related content, including: </div><div class="t m0 x2 h6 y13 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h6 y14 ff1 fs2 fc0 sc0 ls0 ws0">○ <span class="_ _3"> </span>Inappropriate images, messages, or videos involving minors </div><div class="t m0 x5 h6 y15 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h6 y16 ff1 fs2 fc0 sc0 ls0 ws0">○ <span class="_ _3"> </span>Grooming behavior or attempts to contact children in a sexual context </div><div class="t m0 x5 h6 y17 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h6 y18 ff1 fs2 fc0 sc0 ls0 ws0">○ <span class="_ _3"> </span>CSAM (Child Sexual Abuse Material) or links to it </div><div class="t m0 x5 h6 y19 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h6 y1a ff1 fs2 fc0 sc0 ls0 ws0">3. <span class="_ _1"> </span><span class="ff3">User Reporting and Action </span></div><div class="t m0 x2 h6 y1b ff1 fs2 fc0 sc0 ls0 ws0"> Users can easily report any inappropriate behavior or content through ou<span class="_ _0"></span>r in-app </div><div class="t m0 x2 h6 y1c ff1 fs2 fc0 sc0 ls0 ws0">reporting tools. Reports related to CSAE are prioritized and escalated to <span class="_ _0"></span>our T<span class="_ _0"></span>rust &amp; </div><div class="t m0 x2 h6 y1d ff1 fs2 fc0 sc0 ls0 ws0">Safety team within 24 hours. </div><div class="t m0 x2 h6 y1e ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h6 y1f ff1 fs2 fc0 sc0 ls0 ws0">4. <span class="_ _1"> </span><span class="ff3">Collaboration with Law Enforcement and NGOs </span></div><div class="t m0 x2 h6 y20 ff1 fs2 fc0 sc0 ls0 ws0"> We cooperate <span class="_ _0"></span>with local and international law enforcement agencies. W<span class="_ _0"></span>e report </div><div class="t m0 x2 h6 y21 ff1 fs2 fc0 sc0 ls0 ws0">confirmed CSAE incidents to appropriate authorities including: </div><div class="t m0 x2 h6 y22 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h6 y23 ff1 fs2 fc0 sc0 ls0 ws0">○ <span class="_ _3"> </span>National Center for Missing &amp; Exploited Children (NCMEC) </div><div class="t m0 x5 h6 y24 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h6 y25 ff1 fs2 fc0 sc0 ls0 ws0">○ <span class="_ _3"> </span>INHOPE network </div><div class="t m0 x5 h6 y26 ff1 fs2 fc0 sc0 ls0 ws0"> </div><a class="l" href="https://www.drukyul.org/"><div class="d m1" style="border-style:none;position:absolute;left:319.629735px;bottom:1043.389890px;width:290.500520px;height:17.248540px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y0 w0 h0" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w0 h1"><div class="t m0 x1 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x2 h3 y3 ff1 fs1 fc0 sc0 ls0 ws0">Bhutan Echoes<span class="fs2"> - <span class="ff2 fs3 fc1">Drukyul&apos;s Literature Festival Bhutan Echoes</span> </span></div></div><div class="t m0 x5 h6 y27 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x5 h6 y28 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h6 y29 ff1 fs2 fc0 sc0 ls0 ws0">○ <span class="_ _3"> </span>Bhutan Cyber Crime Reporting Portal (if operating in Bhutan) </div><div class="t m0 x5 h6 y2a ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h6 y2b ff1 fs2 fc0 sc0 ls0 ws0">5. <span class="_ _1"> </span><span class="ff3">Age Restrictions &amp; V<span class="_ _2"></span>erification </span></div><div class="t m0 x2 h6 y2c ff1 fs2 fc0 sc0 ls0 ws0"> We do not allo<span class="_ _0"></span>w users under the age of 13 (or as per local laws) to use our services. W<span class="_ _0"></span>e </div><div class="t m0 x2 h6 y2d ff1 fs2 fc0 sc0 ls0 ws0">implement age checks and require parental consent where necessary<span class="_ _2"></span>. </div><div class="t m0 x2 h6 y2e ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h6 y2f ff1 fs2 fc0 sc0 ls0 ws0">6. <span class="_ _1"> </span><span class="ff3">Education &amp; A<span class="_ _0"></span>wareness </span></div><div class="t m0 x2 h6 y30 ff1 fs2 fc0 sc0 ls0 ws0"> We regularly u<span class="_ _0"></span>pdate users and guardians about online safety practices, and of<span class="_ _0"></span>fer </div><div class="t m0 x2 h6 y31 ff1 fs2 fc0 sc0 ls0 ws0">guidance on recognizing and reporting abuse. </div><div class="t m0 x2 h6 y32 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h6 y33 ff1 fs2 fc0 sc0 ls0 ws0">7. <span class="_ _1"> </span><span class="ff3">Data Retention for Investigation </span></div><div class="t m0 x2 h6 y34 ff1 fs2 fc0 sc0 ls0 ws0"> We retain logs<span class="_ _0"></span> and metadata for a period (in accordance with local data laws) to assist </div><div class="t m0 x2 h6 y35 ff1 fs2 fc0 sc0 ls0 ws0">investigations related to CSAE incidents. </div><div class="t m0 x2 h6 y36 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x6 h6 y37 ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y38 ff4 fs5 fc0 sc0 ls0 ws0"><span class="fc2 sc0">🚨</span></div><div class="t m0 x7 h7 y38 ff3 fs5 fc0 sc0 ls0 ws0"> Report Abuse </div><div class="t m0 x1 h6 y39 ff1 fs2 fc0 sc0 ls0 ws0">If you suspect abuse or encounter suspicious behavior on our platform, p<span class="_ _0"></span>lease report it </div><div class="t m0 x1 h6 y3a ff1 fs2 fc0 sc0 ls0 ws0">immediately: </div><div class="t m0 x1 h6 y3b ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x8 h9 y3b ff5 fs2 fc0 sc0 ls0 ws0"><span class="fc2 sc0">📧</span></div><div class="t m0 x7 h6 y3b ff1 fs2 fc0 sc0 ls0 ws0"> <span class="ff3">Email:</span> producer@bhutanechoes.org </div><div class="t m0 x1 h6 y3c ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x8 h9 y3c ff5 fs2 fc0 sc0 ls0 ws0"><span class="fc2 sc0">📞</span></div><div class="t m0 x7 h6 y3c ff1 fs2 fc0 sc0 ls0 ws0"> <span class="ff3">Helpline (if applicable):</span>+975 17 84 90 46 </div><div class="t m0 x1 h6 y3d ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x8 h9 y3d ff5 fs2 fc0 sc0 ls0 ws0"><span class="fc2 sc0">📲</span></div><div class="t m0 x7 h6 y3d ff1 fs2 fc0 sc0 ls0 ws0"> <span class="ff3">In-app Reporting T<span class="_ _2"></span>ool:<span class="ff1"> Option available in My Account page  </span></span></div><div class="t m0 x1 h6 y3e ff1 fs2 fc0 sc0 ls0 ws0"> </div><a class="l" href="https://www.drukyul.org/"><div class="d m1" style="border-style:none;position:absolute;left:319.629735px;bottom:1043.389890px;width:290.500520px;height:17.248540px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.5